import React from 'react'
import { Link } from 'react-router-dom'

function QuestionList (props) {


    const { questionList, text, answered } = props
      return (
        <div className='container'>
            <div className='question-list'>
              <h2 className='special-text'>{text}</h2>
                <ul>
                {questionList.map((id) => {

                  const link = {pathname: `questions/: ${id[0]}`, state: { id: `${id[0]}`, answered}}
                    (<li className='question-link' key={id[0]} >
                      <Link to={link}>
                        <p className='question-link'>
                            	&#8226; Would you rather <b>{id[1].optionOne}</b> <i> than </i>than <b>{id[1].optionTwo}</b>?
                        </p>
                      </Link>
                    </li>)
                  })
                }
              </ul>
            </div>
        </div>
      )
  }

export default QuestionList
